import React, {Component} from 'react';
import Ilustracao from '../../images/app-ilustracao.png'

class Solucao extends Component {
    render() {
        return (
            <section className="container-fluid text-left" style={{ paddingTop:"8%", paddingBottom:"8%"}}>
            <section className="container">
                <div className="row align-items-end">
                        <div className="col-sm">
                          <h1 style={{fontSize:"3rem"}}>O Lixo Eletrônico no Brasil</h1>
                          <p style={{fontSize:"1.2em"}}><strong>Com o objetivo de contribuir para um mundo conectado e sustentável, criamos o e-Leve.</strong></p>
                        </div>
                        <div className="d-inline-flex p-2 bd-highlight mx-auto d-block pb-1">
                        <img className="img-fluid" src={Ilustracao} />
                        </div>
                    </div>
                    </section>
            </section>
        )
    }
};

export default Solucao;
